// import logo from './logo.svg';
import './App.css';
import Login1 from './Components/Login1';
import notFound from './Components/notFound';

import { BrowserRouter as 
Router,
Route,
Link,
Switch,
Redirect 
}
 from 'react-router-dom';


function App() {
  return (
    <Router>
    <div className="App">
      <header className="App-header">
       <Login1 />
      </header>
    </div>   
      <Switch>   
      <Route exact path='/Component/Login1' component={Login1}/>
      <Route exact path='Component/notFound' component={notFound}/>
      <Redirect to="/notFound"/>
    </Switch>
  </Router>


  );
}






export default App;
